import React from "react";
import { useParams } from "react-router-dom";

export default function Commits(props) {
  // console.log(props);
  const params = useParams();
  const { repos } = props;
  // console.log(repos);
  // console.log(params);

  if (repos.length > 0) {
    repos.map((repo) => {
      if (repo.id === params.id) {
        console.log(repo);
      }
    });
  }

  return <div>Commits Page</div>;
}
